Dvanásť štvorcov s rozmermi 1 krát 1 tvorí obdĺžnik, ako je znázornené. Aká je celková plocha vyznačenej oblasti? [asy]
size(4cm);defaultpen(linewidth(0.75));

// Vyplnené časti
fill((0, 4)--(0, 0)--(2, 0)--cycle, gray(0.75));
fill((0, 4)--(3, 4)--(3, 0)--cycle, gray(0.75));

